data = [{name:"Chiang Mai",value:1176.50},{name:"Chiang Rai",value:1562.20},{name:"Kamphaeng Phet",value:742.3},{name:"Lampang",value:461.3},{name:"Lamphun",value:514.6},{name:"Mae Hong Son",value:915},{name:"Nakhon Sawan",value:538.2},{name:"Nan",value:130.9},{name:"Phayao",value:919.7},{name:"Phetchabun",value:2215.7},{name:"Phichit",value:886.4},{name:"Phitsanulok",value:2512.70},{name:"Phrae",value:500.6},{name:"Sukhothai",value:1000.8},{name:"Tak",value:1433.50},{name:"Uthai Thani",value:1012.7},{name:"Uttaradit",value:167.7},]

data.sort(function(a,b){return a.value-b.value});

mapOption = {
  title:mytitle,visualMap:visualMap,
  series: [{type:'map',data:data,id:'population',roam:true,map:'north',animationDurationUpdate:1000,universalTransition:true}]
};

barOption = {
  title:mytitle,visualMap:visualMap,
  yAxis:{type:'value'},xAxis:{type:'category',data:data.map(function(i){return i.name}),axisLabel:{rotate:90},
},
animationDurationUpdate: 1000,
series:{type:'bar',id:'population',data:data.map(function(i){return i.value}),universalTransition:true,}
};

currentOption = barOption;

myChart.setOption(barOption);
setInterval(function () {
  currentOption = currentOption === barOption ? mapOption : barOption;
  myChart.setOption(currentOption, true);
}, 3000);

window.addEventListener('resize',myChart.resize);
</script>

</body>
</html>
